import React from 'react';

const SocialMedia = (element) => {
  const icons = element.map(icon => {
    const { label = '', link = '' } = icon
    return (
      <li></li>
    )
  })

  return (
    <ul>
      {icons}
    </ul>
  )
}

export default SocialMedia
